import React from 'react';
// import 'skeleton-screen-css';
// import 'placeholder-loading-css';

const Skeletond = () => {
	const mystyle = {
		backgroundColor: 'DodgerBlue',
		// padding: '10px',
		// fontFamily: 'Arial',
		// lines: '5',
		width: '100%',
		height: '100%'
	};
	return (
		<div>
			<div class="ph-item">
				<div class="ph-col-12">
					<div class="ph-picture" style={mystyle} />
					<div class="ph-row">
						<div class="ph-col-4" />
						<div class="ph-col-8 empty" />
						<div class="ph-col-12" />
					</div>
				</div>
				{/* <div class="ph-col-2">
					<div class="ph-avatar" />
				</div> */}
				<div>
					<div class="ph-row">
						<div class="ph-col-12" />
						<div class="ph-col-2" />
						<div class="ph-col-10 empty" />
						<div class="ph-col-8 big" />
						<div class="ph-col-4 big empty" />
					</div>
				</div>
			</div>
		</div>
	);
};

export default Skeletond;
